import '../App.css';
import React from "react";
import { useState, button } from "react";

const Pull = () => {

    return (
        <div className="Containner-pull">
            {/* <p className='Text-W'>Please Login before Pull images</p> */}
            <div className='div-butcon'>
            <button
                className='Button-styleCon'
            >
            Standing Contract
            </button>
            <button
                className='Button-styleCon'
            >
            Lying down Contract
            </button>
            </div>
        </div>
    );
};

export default Pull;
